import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import navbar from "navbar.js";

ReactDOM.render(
  <React.StrictMode>
    <navbar/>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
